import React from 'react';
import { Link } from 'react-router-dom';

export default function Navbar () {
    return (
        <React.Fragment>
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <Link to="/" className="navbar-brand">Matches</Link>
            </nav>
        </React.Fragment>
    );
}
